import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import './Products.css';
import { ReactComponent as SearchIcon } from '../assets/search-icon.svg';
import { ReactComponent as EyeIcon } from '../assets/eye-icon.svg';
import { ReactComponent as AddIcon } from '../assets/add-icon.svg';

function Products() {
  const [searchTerm, setSearchTerm] = useState('');
  const navigate = useNavigate();
  
  // Sample data for products
  const products = [
    { name: 'Leche Z', code: '01234', category: 'Lácteo', risk: 'Alto', date: '20/03/24' },
    { name: 'Queso A', code: '12334', category: 'Lácteo', risk: 'Ninguno', date: '17/03/24' },
    { name: 'Manzanas C', code: '74746', category: 'Frutas', risk: 'Alto', date: '12/03/24' },
    { name: 'Leche T', code: '85847', category: 'Lácteo', risk: 'Alto', date: '10/03/24' },
    { name: 'Jugo A', code: '63638', category: 'Bebidas', risk: 'Ninguno', date: '9/03/24' },
    { name: 'Peras B', code: '65757', category: 'Frutas', risk: 'Ninguno', date: '8/03/24' },
    { name: 'Queso Z', code: '99398', category: 'Lácteo', risk: 'Alto', date: '5/03/24' },
    { name: 'Queso R', code: '56578', category: 'Lácteo', risk: 'Ninguno', date: '2/03/24' },
  ];

  const handleSearch = (e) => {
    setSearchTerm(e.target.value);
  };

  const handleViewProduct = (code) => {
    navigate(`/productos/${code}`);
  };

  const handleAddProduct = () => {
    navigate('/productos/agregar');
  };

  return (
    <div className="products-container">
      <div className="search-filter-bar">
        <div className="search-bar">
          <SearchIcon className="search-icon" />
          <input
            type="text"
            placeholder="Buscar producto"
            value={searchTerm}
            onChange={handleSearch}
          />
        </div>
        <button className="filter-button">Agregar filtro</button>
      </div>

      <div className="products-table-container">
        <div className="products-header">
          <h2>Productos</h2>
          <button className="add-product-button" onClick={handleAddProduct}>
            <AddIcon className="add-icon" />
          </button>
        </div>
        <div className="table-wrapper">
          <table className="products-table">
            <thead>
              <tr>
                <th>Nombre</th>
                <th>Código</th>
                <th>Categoría</th>
                <th>Riesgo</th>
                <th>Fecha</th>
                <th></th>
              </tr>
            </thead>
            <tbody>
              {products.map((product) => (
                <tr key={product.code}>
                  <td>{product.name}</td>
                  <td>{product.code}</td>
                  <td>{product.category}</td>
                  <td className={`risk-cell ${product.risk.toLowerCase()}`}>{product.risk}</td>
                  <td>{product.date}</td>
                  <td>
                    <button 
                      className="view-button"
                      onClick={() => handleViewProduct(product.code)}
                    >
                      <EyeIcon className="eye-icon" />
                    </button>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </div>
    </div>
  );
}

export default Products;
